import React from 'react'

export default function () {
    const itemArr = ["name", "Id", "Email", "Score"];
  return (
    <div>
      <div>
        
            <ol>
                {itemArr.map((item) => (
                    <li key={item}>{item}</li>
                ))}
            </ol>
        </div>
    
    </div>
  )
}
